import rain from '../src/assets/cloudy-day.png'
function App() {
  return (
    <div className="App">
      <Header />
      <div className="container">
        <LocationInput />
        <div className="main-content">
          <WeatherCard />
          <Recommendations />
        </div>
      </div>
    </div>
  );
}

export default App;
